import React, { useState} from "react";
import './sponsors.css';
import Button from '@mui/material/Button';
import Modal from '@mui/material/Modal';
import Box from '@mui/material/Box';

function Sponsors() {
    const [open, setOpen] = useState(false);
    const handleOpen = () => setOpen(true);
    const handleClose = () => setOpen(false);

    return (
        <div className="sponsors__main-container">
            <h1 className="sponsors__title">COLABORATORI</h1>
            <div className="sponsors__buttons">
                <Button className="sponsors__button" onClick={handleOpen}> La Butoaie</Button>
                <Modal
                    open={open}
                    onClose={handleClose}
                >
                    <Box className="sponsors__box">
                        ceva
                    </Box>
                </Modal>
            </div>
        </div>
    );
}

export default Sponsors;
